def hamming_distance(p, q):
  mismatches = 0
  for i in range(len(p)):
    if p[i] != q[i]:
      mismatches += 1
      
  return mismatches

def ApproxGenomePositions(Pattern, Genome, d):
    positions = []
    for i in range(len(Genome) - len(Pattern) + 1):
        mismatches = hamming_distance(Genome[i:i+len(Pattern)], Pattern)
        if mismatches <= d:
            positions.append(i)
    return positions
    #return ' '.join([str(pos) for pos in positions])
    


